  [],\n\t\"revision_timestamp\": \"2016-07-27T22:42:09.301436\",\n\t\"name\": \"mercury-and-lead-levels-in-fish-of-the-okefenokee-national-wildlife-refuge\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Thirty five fish were collected for analyses;
  27 from the cast side and 8 from the west side. Samples contained representatives
  of four species; chain pickerel (Exos niger), flier (C. macropterus), largemouth
  bass (M. salmoides) and warmouth (Lepomis gulosus). The mean age and weights of
  these species are shown in Table 1. The arithmetic mean mercury concentration for
  the 35 fish fillets was 0.359 + 0.21 mg/L (wet weight) and 1.69 + 0.92 mg/L (dry
  weight). There were no significant differences within species, among species or
  between years. For wet weights, the range of mercury within the fillets was from
  0.136 ppm (flier) to 1.003 ppm (largemouth bass). Typically, the mean wet weight
  mercury residue values reflect the trophic relationship of each species of fish.
  Mean wet weight mercury concentrations for each species are as follows: five flier
  fillets 0.198 ppm, nine warmouth fillets 0.237 ppm, 13 chain pickerel fillets 0.345
  ppm, eight largemouth bass fillets 0.629 ppm. (Table 2). The dry weight mercury
  concentrations of the fillets ranged from 0.56 ppm (chain pickerel) to 4.22 ppm
  (largemouth bass) (Table 3). The mean wet weight lead concentrations for the 35
  fish fillets was 0.505 + 0.51 mg/L. The mean dry weight lead concentrations for
  the 35 fish fillets was 2.68 + 2.21mg/L. There were no significant differences within
  species, among species or between years. Twenty five of the thirty five fillet samples
  showed detectable lead levels that ranged from 0.213 ppm to 1.56 ppm. Statistically
  meaningful results were not obtainable due to the large variances and small sample
  sizes.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
